import React, { useState } from "react";
import Form from "../Form/Form";

function NewUser(props) {
  const [users, setNewUsers] = useState([
    {
      username: "",
      age: "",
    },
  ]);

  const retrieveData = (prev) => {
    const allUsers = [prev, ...users];
    setNewUsers(allUsers);
  };
  return (
    <div>
      <Form onHandleSubmit={retrieveData} />
      <div> was ,achen sahcen</div>
      <div className="allTodos">
        {users.map((todo) => (
          <div className="flex">

              <div>
                <input id="todoss" className="" type="radio" />
                <label className="radios" for="todoss"></label>
              </div>

              <input name="input" value={todo.text} type="text" />
              <i id="cross" onClick={Delete} className="mr-10 mt-5">
                <svg xmlns="http://www.w3.org/2000/svg" width="18" height="18">
                  <path
                    fill="#494C6B"
                    fill-rule="evenodd"
                    d="M16.97 0l.708.707L9.546 8.84l8.132 8.132-.707.707-8.132-8.132-8.132 8.132L0 16.97l8.132-8.132L0 .707.707 0 8.84 8.132 16.971 0z"
                  />
                </svg>
              </i>

          </div>
        ))}
      </div>
    </div>
  );
}

export default NewUser;
